const SignUpForm = () => {
  return (
    <div>
      <h1>Sign Up with email & password</h1>
      <form action="">
        <label> Display name</label>
        <input required type="text" name="" id="" />
        <label> Email</label>
        <input required type="email" name="" id="" />
        <label> Password</label>
        <input required type="text" name="" id="" />
        <label> Confirm Password</label>
        <input required type="text" name="" id="" />
      </form>
    </div>
  );
};

export default SignUpForm;
